export function checkOptions(options, field) {
    return options ? options[field] : undefined;
}
export function checkStartWithValue(options) {
    return checkOptions(options, 'startWithValue');
}
export function checkIdField(options) {
    return checkOptions(options, 'idField');
}
export * from './auth';
export * from './database';
export * from './firebaseApp';
export * from './firestore';
export * from './performance';
export * from './storage';
export * from './useObservable';
